const sum = (p1, p2) => {
  console.log(p1)
  console.log(p2)
  return p1 + p2
}
const resultsum = sum(1, 5)
console.log(resultsum)


const square = p => {
  return p * p
  console.log(p)
}
const resultsq = square(5)
console.log(resultsq)

function product(a, b) {
  return a * b
}

const resultprod = product(2, 6)
console.log(resultprod)


